import React, { Component } from 'react';
import { StyleSheet, Text, Button, ScrollView, View} from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome';

export default function HomeScreen(props) {
    return (
      
  <ScrollView>
  <View>
        <Text style={{ fontSize: 30, color: 'black', margin: 45 }}>Home Screen</Text>
        <Button
            title="Home"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('StackNavigator', { screen: 'Home' })}
            type="solid"
          />
          <Button
            title="Ecran Tempo"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('EcranTempo') }
            type="solid"
          />
          <Button
            title="Recipe Day 1"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('RecipeDay1') }
            type="solid"
          />
           <Button
            title="Recipe Day 2"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('RecipeDay2') }
            type="solid"
          />
           <Button
            title="Recipe Day 3"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('RecipeDay3' ) }
            type="solid"
          />
           <Button
            title="Recipe Day 4"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('RecipeDay4' ) }
            type="solid"
          />
           <Button
            title="Recipe Day 5"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('RecipeDay5' ) }
            type="solid"
          />
           <Button
            title="Recipe Day 6"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate( 'RecipeDay6' ) }
            type="solid"
          />
         <Button
            title="Recipe Day 7"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('RecipeDay7' ) }
            type="solid"
          />

           <Button
            title="Routine Choice"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('RoutineChoice' ) }
            type="solid"
          />
          <Button
            title="Daily Program"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate( 'DailyProgram' ) }
            type="solid"
          />
          <Button
            title="Bravo"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('Bravo' ) }
            type="solid"
          />
          <Button
            title="Shopping List"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate('ShoppingList' ) }
            type="solid"
          />
          <Button
            title="Profil"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate( 'Profil' ) }
            type="solid"
          />
          <Button
            title="DailyPics"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate( 'DailyPics' ) }
            type="solid"
          />
           <Button
            title="Favorites"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate( 'Favorites' ) }
            type="solid"
          />
          <Button
            title="signin"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate( 'Signin' ) }
            type="solid"
          />
           <Button
            title="Signup"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate( 'Signup' ) }
            type="solid"
          />
          <Button
            title="SearchResults"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate( 'SearchResults' ) }
            type="solid"
          />
          <Button
            title="SnapScreen"
            buttonStyle={{ backgroundColor: "#eb4d4b" }}
            onPress={() => props.navigation.navigate( 'SnapScreen' ) }
            type="solid"
          />
  </View>
  </ScrollView>
     
    );
  }
  
  const styles = StyleSheet.create({
     container: {
       flex: 1,
       alignItems: 'center',
       justifyContent: 'flex-start',
     },
  });
